import React from "react";
import style from "./MealItem.module.css";

const MealItem = (props) => {
  return (
    <li className={style.meal} key={props.meals.id}>
      <div>

      </div>
      <h3>{props.meals.name}</h3>
      <p className={style.description}>{props.meals.description}</p>
      <span className={style.price}>{props.meals.price}</span>
    </li>
  );
};

export default MealItem;
